import React from 'react';
import '../App.css';

function Footer(){
    return(
    <div className="Footer">
        <section id="footer">
            <footer className = "mt-16 flex flex-col justify-center items-center">
                        This site was made by Tyler Rubin
                        <a href="https://www.linkedin.com/in/tyler-rubin/">LinkedIn</a>
                        <a href="https://github.com/jabba67">Github:</a>
            </footer>
        </section>
    </div>
    );
}
export default Footer;
